package forLinkedListLab2;//File: WCSLinkedList.java for Lab 08 CS 64 /*A class for maintaining a linked list. Currently it only contains a constructor forcreating the list, an addLIFO method that adds a new Node at the head of the listand a toString method to return a String representation of the entire list.*/public class WCSLinkedList<E extends Comparable<E>> {	private Node<E> myHead;		public WCSLinkedList () {		myHead = null;	}  //0 parameter constructor		public void addLIFO(E theData) {//Note that this add method has void return type		myHead = new Node<E>(theData, myHead);	}  //addLIFO		public String toString() {		Node mover = myHead;		String tempS = "";		while(mover != null) {			tempS += mover.getData().toString() +"\n";			mover = mover.getLink();		}//while		return tempS;	}  //toString	}//WCSLinkedList